              https://w3id.org/biolink/vocab/Study:
                tag: https://w3id.org/biolink/vocab/Study
                value:
                  string:
                    tag: string
                    value:
                      object:
                        tag: object
                        value: NASA's Rodent Research (RR) project is playing a critical
                          role in advancing biomedical research on the physiological
                          effects of space environments. Due to the limited resources
                          for conducting biological experiments aboard the International
                          Space Station (ISS), it is imperative to use crew time efficiently
                          while maximizing high-quality science return. NASA's GeneLab
                          project has as its primary objectives to 1) further increase
                          the value of these experiments using a multi-omics, systems
                          biology-based approach, and 2) disseminate these data without
                          restrictions to the scientific community. The current investigation
                          assessed viability of RNA, DNA, and protein extracted from
                          archived RR-1 tissue samples for epigenomic, transcriptomic,
                          and proteomic assays. During the first RR spaceflight experiment,
                          a variety of tissue types were harvested from subjects,
                          snap-frozen or RNAlater-preserved, and then stored at least
                          a year at -80C after return to Earth. They were then prioritized
                          for this investigation based on likelihood of significant
                          scientific value for spaceflight research. All tissues were
                          made available to GeneLab through the bio-specimen sharing
                          program managed by the Ames Life Science Data Archive and
                          included mouse adrenal glands, quadriceps, gastrocnemius,
                          tibialis anterior, extensor digitorum longus, soleus, eye,
                          and kidney. We report here protocols for and results of
                          these tissue extractions, and thus, the feasibility and
                          value of these kinds of omics analyses. In addition to providing
                          additional opportunities for investigation of spaceflight
                          effects on the mouse transcriptome and proteome in new kinds
                          of tissues, our results may also be of value to program
                          managers for the prioritization of ISS crew time for rodent
                          research activities.
